import React, { useState, useEffect } from "react";
import End from "./End";
import axios from "axios";

export default function User(props) {
  const [data, setData] = useState([{}]);
  const [test, setTest] = useState("");

  const onChangeTest = (e) => {
    setTest(e.target.value);
  };

  const checkName = () => {
    // props.history.push("/end");
    alert("다음문항으로 이동");
  };

  function fetchData() {
    axios
      .get(
        "http://www.career.go.kr/inspct/openapi/test/questions?apikey=5894ecf675f64f28cd358b417ed6ad1b&q=6"
      )
      .then((response) => {
        const data = response.data.RESULT;
        setData(data);
      })
      .catch((Error) => {
        console.log(Error);
      });
  }
  useEffect(() => {
    fetchData();
  }, []);

  return (
    <>
      <div className="body-container">
        문항
        {data.map((jsondata, idx) => {
          return (
            <>
              <div>
                <label>
                  <input
                    type="radio"
                    name={idx + 1}
                    value={jsondata.answer01}
                    onChange={onChangeTest}
                  />
                  {jsondata.answer01}
                </label>
                <label>
                  <input
                    type="radio"
                    name={idx + 1}
                    value={jsondata.answer02}
                    onChange={onChangeTest}
                  />
                  {jsondata.answer02}
                </label>
              </div>
              <br></br>
            </>
          );
        })}
        <button disabled={test == "" ? true : false} onClick={checkName}>
          다음 문항으로
        </button>
        <br></br>
        <br></br>
      </div>
    </>
  );
}
